import React, { useState, useEffect } from "react";
import Header from "../components/Header";
import firstletterCap from "../utills/firstletterCap";
import {
	Container,
	Col,
	Row,
	Card,
	CardHeader,
	CardBody,
	Collapse,
	Input,
} from "reactstrap";
import API from "../utills/Api";
import { Table, Button } from "react-bootstrap";
import "./css/TrainModel.css";
import cityState from "../jsondropdown/city_state_name.json";
import UserModelInput from "../components/UserModelInput";
const TrainModel = () => {
	const [Modelname, setModelname] = useState("");
	const [city, setCity] = useState("");
	const [State, setState] = useState("");
	const [useModel, setUseModel] = useState("");
	const [SelectedFile, setSelectedFile] = useState(false);
	const [toggleQuestion, setToggequestion] = useState(1);
	const [isAuth, setisAuth] = useState();
	const [ModelNames, setModelNames] = useState([]);

	const getCity = (stateName) => {
		let cities = cityState[stateName];
		console.log(cities);
		return cities.map((city, idx) => {
			return (
				<option key={idx} value={city}>
					{firstletterCap(city)}
				</option>
			);
		});
	};
	const states = () => {
		var keys = Object.keys(cityState);
		return keys.map((state, idx) => {
			return (
				<option key={idx} value={state}>
					{firstletterCap(state)}
				</option>
			);
		});
	};

	useEffect(() => {
		async function checkLogin() {
			let response = await API.get("/check", {
				headers: {
					"x-access-tokens": localStorage.getItem("jwt"),
				},
			});
			response = await response;
			let res_data = { ...response.data };
			console.log(res_data);
			if (res_data.isAuthenticated) {
				setisAuth(true);
			}
		}
		checkLogin();
	}, []);
	useEffect(() => {
		async function getTrainedModels() {
			let response = await API.get("/user_models", {
				headers: {
					"x-access-tokens": localStorage.getItem("jwt"),
				},
			});
			response = await response;
			let res_data = response.data.names;
			setModelNames(res_data);
		}
		getTrainedModels();
	}, [isAuth]);

	const onSubmit = async (e) => {
		e.preventDefault();
		const form = new FormData();
		console.log(SelectedFile);
		form.append("csvfile", SelectedFile, "csvfile");
		form.append("model_name", Modelname);
		form.append("city_name", city);
		form.append("state", State);
		await API.post("/personal_model", form, {
			headers: {
				"Content-Type": "multipart/form-data,",
				"x-access-tokens": localStorage.getItem("jwt"),
			},
		})
			.then((res) => {
				console.log(res);
			})
			.catch((err) => {
				console.log(err);
			});
	};

	return (
		<>
			<Header
				title='Find The Real Price!'
				desc1='This is a simple hero unit, a simple Jumbotron-style component
								for calling extra attention to featured content or information.'
				desc2='It uses utility classes for typography and spacing to space
                content out within the larger container.'
			/>
			{isAuth ? (
				<>
					<Container fluid className='contant-container'>
						<Container fluid>
							<Row>
								<Col>
									<Card className='train-cards-collapse'>
										<CardHeader
											style={{ textAlign: "center" }}
											onClick={() => setToggequestion(1)}>
											<span style={{ fontSize: "40px" }}>How To Use</span>
										</CardHeader>
										<Collapse isOpen={toggleQuestion === 1 ? true : false}>
											<CardBody>example text</CardBody>
										</Collapse>
									</Card>

									<Card className='train-cards-collapse'>
										<CardHeader
											style={{ textAlign: "center" }}
											onClick={() => setToggequestion(2)}>
											<span style={{ fontSize: "40px" }}>
												Train A New Model
											</span>
										</CardHeader>
										<Collapse isOpen={toggleQuestion === 2 ? true : false}>
											<CardBody>
												<Container>
													<form>
														<div class='form-group'>
															<label for='exampleInputEmail1'>
																Name Your Model
															</label>
															<input
																class='form-control'
																placeholder='Model Name'
																type='text'
																value={Modelname}
																onChange={(e) => setModelname(e.target.value)}
															/>
														</div>
														<div class='form-group'>
															<label for='exampleInputEmail1'>City</label>
															<Input
																type='select'
																name='State'
																value={State}
																onChange={(e) => setState(e.target.value)}
																style={{ marginTop: "24px" }}>
																<option selected value>
																	-- select an option --
																</option>
																{states()}
															</Input>
														</div>
														<div class='form-group'>
															<label for='exampleInputEmail1'>State</label>
															<Input
																type='select'
																name='city'
																onChange={(e) => setCity(e.target.value)}
																value={city}
																style={{ marginTop: "24px" }}>
																<option selected value>
																	-- select an option --
																</option>
																{getCity(State)}
															</Input>
														</div>
														<div class='form-group'>
															<label for='csvupload'>Upload CSV</label>
															<input
																class='form-control'
																placeholder='Upload FIle'
																type='file'
																name='CSV'
																onChange={(e) =>
																	setSelectedFile(e.target.files[0])
																}
															/>
														</div>
														<button
															type='submit'
															onClick={(e) => onSubmit(e)}
															class='btn btn-primary'>
															Submit
														</button>
													</form>
												</Container>
											</CardBody>
										</Collapse>
									</Card>
								</Col>
							</Row>
						</Container>
					</Container>
					<Container fluid className='contant-container'>
						<Row>
							<Col>
